import React from 'react';
//import ReactDOM from 'react-dom';
import './App.css';

function Button(props) {
  return (
    //<div>
      <button onClick={() => alert(`${props.buttonInfo.loginCustomText}`)}>
        { props.buttonInfo.loginButtonText }
      </button>
      /* <button onClick={() => alert(`${props.buttonInfo.signupCustomText}`)}>
        { props.buttonInfo.signupButtonText }
      </button>
    </div> */
  );
}

class JSXElement extends React.Component {
  renderButton(text, message) {
    return <Button
      buttonText={text}
      onClickMessage={message}
    />
    }
  render() {
    return (
      <div>
        {this.renderButton(this.props.buttonInfo.loginButtonText, this.props.buttonInfo.loginCustomText)}

      </div>
    )
  }
}


export default JSXElement;
